  false,\n\t\"url\": null,\n\t\"notes\": \"This report is from a workshop to discuss
  aspects of wetland management in the Lahontan Valley. The workshop, described in
  this report, had three primary objectives: to discuss the types and relative proportions
  of primary wetland habitats that should be provided as described in the settlement
  act; to discuss wetland management models that might be developed to help manage
  these marshes under hydrologic regimes likely in the future; and to discuss future
  information and monitoring needs, including proposals for valley-wide biodiversity
  surveys, which would be helpful when considering withdrawn Bureau of Reclamation
  (BR) lands for possible incorporation into Stillwater National Wildlife Refuge.\",\n\t\"owner_org\":
